import "./File.css";

function Hellow(){
    return <div className="file-style">
        <h1>Hellow HTML</h1>
        <h2>Hellow Css</h2>
        <h3>Hellow Javascript</h3>
        <h4>Hellow Reactjs</h4>
    </div>
}

export default Hellow;
